import React from 'react'


function Pi(props) {
  return (
    <div>
      <p>{props.prenom} {props.nom} [ {props.totem} ] : a pour l'instant fourni la somme de {props.timing}h de travail.</p>
    </div>
  )
}

export default Pi;
